import React from 'react'

import aboutMain from "../../assets/images/aboutUs/img1.png";

function About() {
  return (
    <section className="about" id="About">
      <div className="container section_wrapper">
        <div className="row about_wrapper">
          <div className="col-6 service_left">
            <img src={aboutMain} />
          </div>
          <div className="col-6 service_right">

            </div>
        </div>
      </div>
    </section>
  );
}

export default About
